window.bookSummaryJSON = "<p><b><i>June Hanson</i></b></p> <p>Calix Moore was like nothing I’d ever experienced in this life.</p> <p>He stormed in with no regard for what it might do to my heart, only his own.</p> <p>I wanted to open up and give him a chance, same as I had the first night we met—the night we threw all caution to the wind and spent twelve passionate hours behind closed doors.</p> <p>But when the sky brightened, and I looked next to me, I knew I could never allow him to see me again. Except fate had other plans and now he’s standing in front of me, at my place of business, with a knowing smirk pulling at his lips.</p> <p>I hadn’t been prepared for this, <i>for him.</i></p> <p><b><i>Calix Moore</i></b></p> <p>June Hanson was everything I wanted to experience in this life.</p> <p>She embodied the love I wanted to give and receive.</p> <p>I wanted her to open up and give me a chance to prove myself, like she had the first night we met—the night I looked across the empty bar we were in and decided I would convince her to leave with me.</p> <p>When I woke the next morning and found she’d left, I thought I’d never see her again. Until fate stepped in and brought me to her once more.</p> <p>I prepared for this, <i>for her.</i></p>"; 
